@YZ @Han 

let me try to explain why the new discord task will continue to be plagued with the copying exploit:

1. There are only ~37 channels and ~11 themes of questions i.e (37X11) = ~400 unique question possibilities ONLY

2. Since answers are to be fetched only from THE specific channel and actual meaningful discussions on these themes in each channel are very limited, even if the llm was to stitch a slightly different question for each theme in every new validator evaluation round, the expected responses that can be sent for this new question will largely be the same for a specific theme

3. So Essentially any validator just needs to query miners for these 400 unique themes, which if they want they can do in 1 hr itself.. and then the work is done... no meaningful competition left and validator running miners will have the upper hand leeching on the efforts of a sincere miner, who has done all the hard work of building the semantic model, deploying gpu resources etc...

Hence, I am afraid the new semantic discord task also won't fall under the purview of efficient miner-validator task design... What do you say?

Hi @Han

There is a minor but critical bug in the validator part of the code. In bittensor_channels.json file we have around 44 channels but in BITTENSOR_DISCORD_CHANNEL_PROJECS in tasks file we have around 46 projects mentioned. We are specifically missing any channel_id for project # 38 and 45. Where this  breaks the code is in evaluation function where we are trying to get project_name from channel_id, specifically following part of the code.

channel_id_to_project_name = {}
            for channel_info, project_name in zip(
                channels, BITTENSOR_DISCORD_CHANNEL_PROJECS.values()
            ):
                channel_id_to_project_name[channel_info["channel_id"]] = project_name


This results in incorrect mapping between project name and channel_id from EdgeMaxing onwards... Would request you please fix this as it results in incorrect evaluation of few projects in the end.

@Han there is a currently a possible exploit in the new release that needs rectifying. 

The field doc['author_nickname'] on line 882 of evaluator.py which is used in the llm_discord_semantic_search_conversation_evaluation function is not checked against any field in the groundtruth documents, as such you can simply inject whatever you would like in responses being sent back to validators and get all meaningful scores.

Just as a side note there is also what I am guessing is a typo on line 955 of evaluator.py, where the llm_discord_semantic_search_conversation_evaluation function is recursively calling the llm_semantic_search_evaluation function rather than itself

@Han @YZ [Kaito AI] | SN5 it seems the new timeout has an impact on validators, and more specifically on smaller ones. 
This is a graph that shows the proportion of null responses per validator since the 10s timeout. There were already a drop when it moved from 20s to 15s, but now the drop is even bigger.
It seems to be affecting the smaller validators first (maybe less powerful servers), but the bigger ones are most probably being affected to

@Han 2 other points I've noted in the answers that might need to be addressed:
- some miners return conversations with only 1 message per conversation. I don't think a single message can be considered as a conversation, and we might want to enforce a minimum number of messages 
- some queries are being created for "Project Unknown", which doesn't have any channel associated to it. How would that work out with the patch you're suggesting to enforce the channel id?

@Han there might be a problem with the logs on Wandb. My guess is that the data is too big to be logged now, and validator can't even send it to Wandb. 
When trying to retrieve it from the api either wandb breaks, or the data is not available even though it's the latest run for the validator. 
Would it be possible to check with validators if they're actually successfully sending the data?

@YZ [Kaito AI] | SN5 what do the current miner success logs look like? 

I have heard some people say it gives looks like "recieved request, processed request, etc." 

but mine just print out the info about my miner, like epoch, uid, stake, rank, etc.
